// Default imports
import React from 'react';
import './home.scss';

const Home = () => {
    return (
        // HTML here
        <div className="contentCenter">
            <div className='fontSize'>
                Hello, I'm <span className="blue-text">Neerav Panchal</span>.<br/>
                I'm a full-stack web developer.
            </div>
            <br/>
            <a href='/about' className="waves-effect waves-light btn blue">Find out more.</a>
        </div>
    )
};

// Default export
export default Home;
